import React from 'react';
import { BrowserRouter as Router, Route, Switch, useHistory } from 'react-router-dom';
import { Button, Typography, Paper, Grid } from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';
import { PlayArrow, School, Timeline } from '@material-ui/icons';
import Layout from './components/Layout/Layout';

const useStyles = makeStyles((theme) => ({
  root: {
    minHeight: '100vh',
    backgroundColor: '#f5f5f5',
    padding: theme.spacing(4),
  },
  header: {
    textAlign: 'center',
    marginBottom: theme.spacing(6),
  },
  title: {
    color: '#1a237e',
    marginBottom: theme.spacing(2),
    fontWeight: 'bold',
  },
  card: {
    padding: theme.spacing(3),
    height: '100%',
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    transition: 'transform 0.2s',
    '&:hover': {
      transform: 'translateY(-5px)',
    },
  },
  icon: {
    fontSize: 48,
    marginBottom: theme.spacing(2),
    color: '#1a237e',
  },
  startButton: {
    marginTop: theme.spacing(4),
    backgroundColor: '#1a237e',
    color: 'white',
    '&:hover': {
      backgroundColor: '#000051',
    },
  },
  gridContainer: {
    marginBottom: theme.spacing(4),
  },
}));

const LandingPage = () => {
  const classes = useStyles();
  const history = useHistory();

  const handleStart = () => {
    history.push('/visualizer');
  };

  return (
    <div className={classes.root}>
      <div className={classes.header}>
        <Typography variant="h2" className={classes.title}>
          Graph Algorithm Visualizer
        </Typography>
        <Typography variant="h5" color="textSecondary">
          Learn and visualize graph algorithms step by step
        </Typography>
      </div>

      <Grid container spacing={4} className={classes.gridContainer}>
        <Grid item xs={12} md={4}>
          <Paper elevation={3} className={classes.card}>
            <Timeline className={classes.icon} />
            <Typography variant="h5" gutterBottom>
              Graph Traversal
            </Typography>
            <Typography align="center" color="textSecondary">
              A graph is a simple collection of nodes/vertices connected by edges. Traversing the graph means going from node to node . There are various ways a graph can be traversed
            </Typography>
          </Paper>
        </Grid>

        <Grid item xs={12} md={4}>
          <Paper elevation={3} className={classes.card}>
            <School className={classes.icon} />
            <Typography variant="h5" gutterBottom>
              BFS and DFS
            </Typography>
            <Typography align="center" color="textSecondary">
              BFS stands for Breadth First Search while DFS stands for Depth First Search . In BFS we first traverse all adjace
            </Typography>
          </Paper>
        </Grid>

        <Grid item xs={12} md={4}>
          <Paper elevation={3} className={classes.card}>
            <PlayArrow className={classes.icon} />
            <Typography variant="h5" gutterBottom>
              Practice Mode
            </Typography>
            <Typography align="center" color="textSecondary">
              Create custom graphs and watch algorithms in action
            </Typography>
          </Paper>
        </Grid>
      </Grid>

      <div style={{ textAlign: 'center' }}>
        <Button
          variant="contained"
          size="large"
          className={classes.startButton}
          onClick={handleStart}
          startIcon={<PlayArrow />}
        >
          Start Visualizing
        </Button>
      </div>
    </div>
  );
};

const App = () => {
  return (
    <Router>
      <Switch>
        <Route exact path="/" component={LandingPage} />
        <Route path="/visualizer" component={Layout} />
      </Switch>
    </Router>
  );
};

export default App;
